DROP TABLE IF EXISTS `category`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `category` (
  `id` bigint unsigned NOT NULL AUTO_INCREMENT,
  `created_at` datetime(3) DEFAULT NULL,
  `updated_at` datetime(3) DEFAULT NULL,
  `deleted_at` datetime(3) DEFAULT NULL,
  `parent_id` int unsigned NOT NULL COMMENT ' 分类上级ID',
  `admin_id` int unsigned NOT NULL COMMENT ' 管理员ID',
  `type` tinyint NOT NULL DEFAULT '1' COMMENT ' 类型1默认类型',
  `name` varchar(60) NOT NULL COMMENT ' 标题',
  `icon` varchar(60) NOT NULL COMMENT ' 封面',
  `sort` tinyint NOT NULL DEFAULT '99' COMMENT '排序',
  `status` tinyint NOT NULL DEFAULT '10' COMMENT ' 状态-1禁用 10启用',
  `data` text COMMENT ' 数据',
  PRIMARY KEY (`id`),
  KEY `idx_category_deleted_at` (`deleted_at`)
) ENGINE=InnoDB AUTO_INCREMENT=13 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='产品分类表';
